import { ClientCardData } from "../RouteListFolder/clientCardData"
import { MoreClientData } from "../RouteListFolder/moreClientData";


export const TrashedRoutes = ( { routesTrashed, setRoutesTrashed,routesList, setRoutesList } ) => {

  const recover = ( clientData )=>{

    setRoutesList([...routesList, clientData])
    
    
    const filterList = routesTrashed.filter((e)=>  e.id != clientData.id );
 
    setRoutesTrashed(filterList);
    
  }


  return (
      <>
          <section className = 'RoutesListContainer'>

            { routesTrashed.map( (e)=>
            
              <div key = { e.directionRoute } className='clientCard'>

                <ClientCardData clientData = { e }/>

                <button onClick={()=> recover(e) }
                        style = { {backgroundColor:'#a0e7f2',
                        border:'none',
                        borderRadius:'20px',
                        fontWeight:'bold'}}> 

                  RECUPERAR  
                
                </button>

              </div>
            
            ) }

          </section>

          <MoreClientData/>
      </>
  )  
}
